import React from "react";
import "./index.css";
import "./str.jpeg";
function Nav(){
   return (
    <div className="nav">
        <span>List of my favourate webseries</span>
    </div>
);
}
function Card(props){
    return(
        <>
            <div className="card">
                <div className="image">
                    <img src={props.imgsrc}/>
                </div>
                <div className="info">

                </div>
            </div>
        </>
    );
}
export default Nav;
export {Card};
